function combineAgentSchedulesPerDay(rangeData) {
  const rangeCondensedAvailability = Array.from(rangeData || [])
    .map(({ agents, day: utcDate, dayOfWeek, dayOfWeekOrd, dayOfYear, month }) => {
      let t = new Date(utcDate);
      const localDate = new Date(t.getUTCFullYear(), t.getUTCMonth(), t.getUTCDate());
      return {
        day: localDate,
        dayOfWeek,
        dayOfWeekOrd,
        dayOfYear,
        month,
        events: combineAgentSchedules(agents)
      };
    });
  console.log(rangeData, rangeCondensedAvailability);
  return rangeCondensedAvailability;
}

function combineAgentSchedules(agentSchedules) {
  const timeChunks = [];

  // Flatten all agent schedules into a single array of events
  const events = agentSchedules.flatMap(({ agent, hours }) =>
    hours.parsed.map(({ sta, fin }) => ({ sta, fin, agent, }))
  );

  // Sort events by start time, then by end time
  events.sort((a, b) => (a.sta !== b.sta) ? a.sta - b.sta : a.fin - b.fin);

  let lastEnd = 0;

  for (const { sta, fin, agent } of events) {
    // Add the current event as a separate time chunk
    const validStart = Math.max(sta, lastEnd);
    const validDuration = Math.round((fin - validStart) / 10) * 10;
    if (validDuration > 0) {
      timeChunks.push({
        sta: validStart,
        fin,
        dur: validDuration,
        agent: agent,
      });
    }

    lastEnd = Math.max(lastEnd, fin);
  }

  // console.log(events, timeChunks);

  return timeChunks;
}
